import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { Card, ListGroupItem, ListGroup } from 'react-bootstrap';


class StockComp extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            name: this.props.item.name,
            stockPrice: this.props.item.stockPrice,
            perform: this.props.item.perform,
            sector: this.props.item.sector
        }
    }

    render() {
        return (
            <Card style={{ width: '18rem' }}>
            <Card.Body>
                <Card.Title>Apple Inc</Card.Title>
                <Card.Subtitle className="mb-2 text-muted">AAPL</Card.Subtitle>
                <Card.Text>Apple Inc</Card.Text>
                <Card.Link href="#">Purchase Stock</Card.Link>
                <Card.Link href="#">Another Link</Card.Link>
            </Card.Body>
            </Card>
        )
    }
}


export default StockComp;
